import React from 'react';
import {BrowserRouter as Router,Route} from 'rreact-router-dom';
import Sapling from './components/sapling';

const App=()=>{
    return (
        <Router>
            <Route path="/sapling" component={Sapling}/>

        </Router>

    )
};
export default App;
